import React from "react";
import './contact.css'
import Header from "../../components/Header/Header";
const contact = ()=>{
    return(
        <>
        {/* <Header/> */}
        <div className="container">
      <div className="contact-section">
        <h1>Contact Acme Outdoors</h1>
        <div className="contact-options">
          <div className="contact-block">
            <h2>Contact Us</h2>
            <p>Just want to say hi? We'd love to hear from you. We love our customers and community!</p>
            <button className="contact-button">Send Us A Message</button>
          </div>
          <div className="contact-block">
            <h2>Get Support</h2>
            <p>Have an issue with an order or with a product you purchased from us? Fill out our support form.</p>
            <button className="contact-button">Contact Support</button>
          </div>
        </div>
      </div>
      <div className="image-section">
        <img src="https://via.placeholder.com/150" alt="Smiling woman with phone" />
      </div>
    </div>
        </>
    );
};

export default contact;
